import React, {
  Fragment,
  Component,
  Suspense,
  useState,
  useEffect
} from 'react';
import { Route, Switch, Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const CreateProfile = () => {
  const [formData, setFormData] = useState({
    company: '',
    website: '',
    location: '',
    bio: '',
    status,
    githubusername: '',
    skills: '',
    youtube: '',
    facebook: '',
    twitter: '',
    instagram: ''
  });

  return (
    <div>
      <h3>Создай свой профиль ЧУУУВАКК</h3>
    </div>
  );
};
CreateProfile.propTypes = {};

export default connect(
  null,
  {}
)(CreateProfile);
